INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (1, "ぺコリーヌ", 40001, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 1, 37, 150, 8, 0, 91002, 107501);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (2, "コッコロ", 40001, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 1, 38, 150, 8, 0, 91002, 107601);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (3, "キャル", 40001, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 1, 39, 150, 8, 0, 91002, 107801);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (4, "スズメ", 40001, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 1, 40, 150, 8, 0, 91002, 107701);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (5, "タマキ", 40001, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 1, 41, 150, 8, 0, 91002, 107901);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (6, "ぺコリーヌ", 40001, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 2, 42, 150, 8, 0, 91002, 107501);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (7, "コッコロ", 40001, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 2, 43, 150, 8, 0, 91002, 107601);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (8, "キャル", 40001, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 2, 44, 150, 8, 0, 91002, 107801);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (9, "スズメ", 40001, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 2, 45, 150, 8, 0, 91002, 107701);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (10, "タマキ", 40001, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 2, 46, 150, 8, 0, 91002, 107901);
