INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (1, "リリ", 40011, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 321, 1, 2, 0, 24001, 125801);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (2, "クリア", 40011, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 322, 1, 2, 0, 24001, 126001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (3, "プレシア", 40011, "んーと。\nこれ、あげる。\nはい", 1, 323, 1, 2, 0, 24001, 126101);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (4, "リリ", 40011, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 324, 1, 2, 0, 24001, 125801);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (5, "クリア", 40011, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 325, 1, 2, 0, 24001, 126001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (6, "プレシア", 40011, "お兄。\nきてくれて、うれしい", 2, 326, 1, 2, 0, 24001, 126101);
